import './main.scss';
// import { useHistory } from "react-router-dom";


const Arrows = (props) => {
    // const history = useHistory();
    return (
        <div id="arrows-div">
            <button onClick={() => props.history.goBack()}>Back</button>
            <button onClick={() => props.history.goForward()}>Forward</button>
        </div >
    );
}

export default Arrows;
